import React from 'react';

class OrganismList extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            organisms: [],
            selectedOrganism: '',
            organismConfigs: {},
        };
    }

    render() {
        return (
            <h1> This is the organism list</h1>
        )
    }
}

export default OrganismList;
